import React from "react";
import "./news.scss";

const News = ({ name, imgUrl, message }) => {
  return (
    <div className="newsbox">

      <img src={process.env.PUBLIC_URL + imgUrl} alt={name} />
      <h3>{name}</h3>
      <h4>{message}</h4>
    </div>
  );
};

export default News;
